text:
@NirmalPrasai5 यो विदेशी को भाष्य निर्माण गरेर प्रकारान्तर मा देश खुईल्याउने प्रवृत्ति बाट निस्कनु जरुरी छ
आफ्नो स्वार्थ पुरा नभये विदेशी को ठप्पा कती सजीलो न्यारेटिभ
अनि मलाई अमेरिका भारत को साथ छ त्यो नाथे कसैले गठबंधन तोड़ेर हुने केई हुन्न भन्ने त गयो त सर जी

यत्ती बुझे पुग्छ नेपालको राजनितिमा Leader नभै छेपारोहरुको राज छ त्यसैले कुनैपनी समय रङ्ग परिवर्तन हुनसक्छ । परिवर्तित रङ्गलाई देखेर कसैले अचम्म नमानेहुन्छ ।भेडा जनता नै हुन अनि मुर्ख झोला बोल्ने कार्यकर्ता नै।

